      <text id="9" justification="0" size="4" underlined="false">
        <text>Un porto è caratterizzato da un nome, dalla località in cui si trova e dai posti barca che possiede. Il porto è suddiviso in moli numerati progressivamente con una tariffa giornaliera di ormeggio differente e una lunghezza e larghezza massima ammissibile per le barche,
 ciascun molo è formato da più posti barca, ciascuno dei quali ha un numero progressivo e può essere o meno occupato da una barca per tot giorni. Ogni barca possiede un nome, una nazionalità un proprietario e una lunghezza e larghezza. Deve essere possibile
data una barca visualizzare i posti liberi in cui può essere ormeggiata con l’importo totale che dovrà pagare.</text>
      </text>
